import React from "react";

export default (props: { type: boolean; name: boolean; field: string }) => {
  if (
    (props.type && props.field === "type") ||
    (props.name && !props.type && props.field === "name")
  ) {
    return <p style={{ color: "green" }}>{props.field}</p>;
  } else {
    return <p>{props.field}</p>;
  }
};
